import React, { Component } from "react";
import "./Selling.css";

export class Selling extends Component {
  render() {
    return (
      <>
        <div className="selling-whole">
          <div className="jumbotron jumbotron-fluid jumbotron-search">
            <div className="container"></div>
          </div>
        </div>
      </>
    );
  }
}
